import React from 'react';
import './App.css';

import MangoIcon from './components/MangoIcon';

function App()
{
	return (
		<div style={{position: 'fixed', width: '100vw', height: '100vh'}}>
			<MangoIcon />
		</div>
	);
}

export default App;
